const projects = [
  {
    title: "Crypto price Tracker",
    image: "./images/coinbase.png",
    description: "Realtime access to prices of over 250 crypto currencies",
    tools: ["React", "CSS", "webSockets"],
    github: "https://github.com/Naman-l/cryptoprice-tracker",
    link: "http://cryptoprice-tracker.vercel.app/",
  },
  {
    title: "Twitter Clone",
    image: "./images/twitterClone.png",
    description:
      "Twitter UI clone,frontend clone but maintains a realtime database if anyone tweets",
    tools: ["React", "CSS", "firebase", "API", "Tailwind", "axios"],
    github: "https://github.com/Deelip7/react-tmdb-app",
    link: "https://festive-wilson-a51c32.netlify.app/",
  },
];

export default projects;
